function Docs() {
    return(
        <div>
            <br></br>
            <h1>Documentation</h1>
            <br></br>
            <p>GameNews App is a platform to fetch and display news related to games. It allows users to search for games and view their latest updates in a user-friendly modal interface.</p>
        </div>
    )
}
export default Docs
